let h = -3.7_f32;
let i = 3.5_f32;
let j = 4.5_f32;

assert_eq!(f32::math::round(f), 3.0);
assert_eq!(f32::math::round(g), -3.0);
assert_eq!(f32::math::round(h), -4.0);
